// Note that we don't yet support `indirect` for enums.
// See https://github.com/mozilla/uniffi-rs/issues/396 for further discussion.
/**
 * Recording state enum.
 */

public enum RecordingState {
    
    case idle
    case listening
    case processing
    case done(text: String
    )
    case error(message: String
    )
}


#if compiler(>=6)
extension RecordingState: Sendable {}
#endif

#if swift(>=5.8)
@_documentation(visibility: private)
#endif
public struct FfiConverterTypeRecordingState: FfiConverterRustBuffer {
    typealias SwiftType = RecordingState

    public static func read(from buf: inout (data: Data, offset: Data.Index)) throws -> RecordingState {
        let variant: Int32 = try readInt(&buf)
        switch variant {
        
        case 1: return .idle
        
        case 2: return .listening
        
        case 3: return .processing
        
        case 4: return .done(text: try FfiConverterString.read(from: &buf)
        )
        
        case 5: return .error(message: try FfiConverterString.read(from: &buf)
        )
        
        default: throw UniffiInternalError.unexpectedEnumCase
        }
    }

    public static func write(_ value: RecordingState, into buf: inout [UInt8]) {
        switch value {
        
        
        case .idle:
            writeInt(&buf, Int32(1))
        
        
        case .listening:
            writeInt(&buf, Int32(2))
        
        
        case .processing:
            writeInt(&buf, Int32(3))
        
        
        case let .done(text):
            writeInt(&buf, Int32(4))
            FfiConverterString.write(text, into: &buf)
            
        
        case let .error(message):
            writeInt(&buf, Int32(5))
            FfiConverterString.write(message, into: &buf)
            
        }
    }
}


